package pri;

public class Numswap {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a=10;
		int b= 20;
		System.out.println("before swaping");
		System.out.println("a="+a);
		System.out.println("b="+b);
		
		System.out.println("after swaping");
		
		int temp;
		temp=a;
		a=b;
		b=temp;
		System.out.println("a="+a);
		System.out.println("b="+b);
		
		
		

	}

}
